    render(){
        var elements = ["element1","element2","element1","element2","element1","element2"]
        const name = "Hello";

        return(
            
            <div>
                <ul> {

                    elements.map((element,index)=>
                         <li key={index}>{name} {element}</li>
                    )
                } </ul>
            
          
    </div>
            
        )
    }
}

export default App;
